import React from "react";
import Input from "../Input/Input";
import Button from "../Button/Button";
const LoginForm = () => {
  const handleFormChange = (value, type) => {
    console.log("test kimo value", value, type);
  };
  return (
    <div className="flex flex-col border-2 border-cyberBlue rounded-xl  w-3/4 pt-16 pb-8  shadow-lg  shadow-cyberBlue gap-8 bg-cyberDarkBlue">
      <Input
        type="text"
        handleChange={(value) => handleFormChange(value, "email")}
        placeholder="E-mail"
      />

      <Input
        type="password"
        handleChange={(value) => handleFormChange(value, "password")}
      />
      <div className="pt-8">
        <Button text="Login" />
      </div>
    </div>
  );
};

export default LoginForm;
